import React from 'react';
import './App.css';
import MediaPlayer from './components/MainComponents/MediaPlayer/MediaPlayer';
import Visualizer from './components/MainComponents/Visualizer';
import CookieConsent from "react-cookie-consent";

class App extends React.Component {
  constructor(props) {
    super(props);
    const cookies = new Cookies();
    this.state = {
      currentFrequence: 1,
      currentSongName: cookies.get('songName'),
      currentSongID: cookies.get('songID'),

    }
    this.setCurrentFrequency = this.setCurrentFrequency.bind(this);
    this.updateCurrentSong = this.updateCurrentSong.bind(this);
  }

  updateCurrentSong(songName, songID) {
    const cookies = new Cookies();
    this.setState({
        currentSongName: songName,
        currentSongID: songID,
    });
    if (songID) {
        cookies.set('songName', songName, { path: '/', secure: true });
        cookies.set('songID', songID, { path: '/', secure: true });
    } else {
        cookies.remove('songName', songName, { path: '/', secure: true });
        cookies.remove('songID', songID, { path: '/', secure: true });
    }
}

  setCurrentFrequency(currentFrequence) {
    this.setState({ currentFrequence: currentFrequence })
  }
  render() {
    return (
      <main className="container-md">
        <div className="row">
          <div className="col-md-12 col-lg-5">
            <MediaPlayer
              changedFrequencyCallback={this.setCurrentFrequency}>
            </MediaPlayer>
          </div>
          <div className="col-md-12 col-lg-7">
            <CookieConsent>This site uses cookies.</CookieConsent>
            <Visualizer />
          </div>
        </div>
      </main>
    )
  }
}

export default App;
